import React from 'react';
import { Grid, Paper, Typography } from '@mui/material';

const sideNavStyle = {
    height: '100%',
    padding:'10px'
};


const Home = () => {


    return (
        <Grid container spacing={2} style={{ height: '100vh' }}>
            {/* Side Navigation */}
            <Grid item xs={3} style={{ height: '100%',padding }}>
                <Grid container direction="column" spacing={2} style={{ height: '100%' }}>
                    {/* First Grid */}
                    <Grid item style={{ height: '20%' }}>
                        <Paper style={{ ...sideNavStyle }}>
                            <div style={{ padding: '10px' }}>
                                <Typography variant="h6">First Part</Typography>
                                {/* Add your first part content here */}
                            </div>

                        </Paper>
                    </Grid>


                    {/* Second Grid */}
                    <Grid item style={{ height: '80%' }}>
                        <Paper style={{ ...sideNavStyle }}>
                            <div style={{ padding: '10px' }}>
                                <Typography variant="h6">Second Part</Typography>
                                {/* Add your second part content here */}
                            </div>
                        </Paper>
                    </Grid>
                </Grid>
            </Grid>

            <Grid item xs={9} container direction="column" style={{ height: '100%' }}>
                {/* Header */}
                <Grid item style={{ height: '20%' }}>
                    <Paper style={{ ...sideNavStyle }}>
                        <Typography variant="h6">Header</Typography>
                        {/* Add your header content here */}
                    </Paper>
                </Grid>

                {/* Main Screen */}
                <Grid item style={{ flexGrow: 1, height: '80%' }}>
                    <Paper style={{ ...sideNavStyle }}>
                        <Typography variant="h6">Main Screen</Typography>
                        {/* Add your main screen content here */}
                    </Paper>
                </Grid>
            </Grid>
        </Grid>
    );
};

export default Home;
